'use strict';


const image64 = `
data:image/jpeg;base64,
`

// stats
var stats = new Stats();
stats.setMode(0);
stats.domElement.style.position = 'absolute';
stats.domElement.style.left = '-100px';
stats.domElement.style.top = '-100px';
document.body.appendChild(stats.domElement);

const image = document.createElement("img");
image.src = image64;

const getImageData = function (image) {
    const canvasImg = document.createElement("canvas");
    canvasImg.width = image.width;
    canvasImg.height = image.height;
    const ctxImg = canvasImg.getContext("2d");
    ctxImg.drawImage(image, 0, 0);

    return ctxImg.getImageData(0, 0, image.width, image.height);
};

let lastKnownScrollPosition = 0;
let ticking = false;
const h = innerHeight;

setTimeout(() => {
    const alphaConst = true;

    const imagedata = getImageData(image);
    const canvas = document.getElementById('amedomary');
    const sizeSqureSide = innerHeight > innerWidth ? innerWidth : innerHeight;
    canvas.width = sizeSqureSide - 20;
    canvas.height = sizeSqureSide - 41;
    const ctx = canvas.getContext('2d', { alpha: alphaConst });

    const canvasStatic = document.getElementById('static');
    canvasStatic.width = canvas.width;
    canvasStatic.height = canvas.height;
    const ctxStatic = canvasStatic.getContext('2d', { alpha: alphaConst });

    // Prerender canvas
    const canvasPrerender = document.createElement("canvas");
    canvasPrerender.width = canvas.width;
    canvasPrerender.height = canvas.height;
    const ctxPrerender = canvasPrerender.getContext('2d', { alpha: alphaConst });

    const paddingTop = (canvas.width / 2) - (image.width / 2);
    const paddingLeft = (canvas.height / 2) - (image.height / 2);
    const centerW = canvas.width / 2;
    const centerH = canvas.height / 2;

    const mash = [];
    let doneDots = 0;
    const dotSize = 1;
    const imgStep = dotSize;
    const blackBorder = 24;
    const speed = {
        down: 0.5,
        top: 10,
    }

    // game loop
    let last = performance.now();
    const FPS = 60; //  
    const STEP = 1 / FPS; // update should be called 60 times per second
    let dt = 0;
    let now;

    function getRandomArbitrary(min, max) {
        return Math.random() * (max - min) + min;
    }

    // function getCosRad(x1, y1, x2, y2) {
    //     return Math.acos(((x1*x2 + y1 * y2) / (Math.sqrt( x1**2 + y1 ** 2 ) * Math.sqrt( x2**2 + y2 ** 2 ))));
    // }
    // console.log(getCosRad(1,0,1,1));

    function getAngle(x1, y1, x2, y2) {
        const a = y1 - y2;
        const b = x1 - x2;
        const c = Math.sqrt((a ** 2 + b ** 2));
        const cos = a / c;
        const sin = b / c;

        return { cos, sin }
    }

    class Dot {
        constructor(x, y, color) {
            this._x = x + paddingTop;
            this._y = y + paddingLeft;

            this.x = getRandomArbitrary(0, canvas.width);

            this._dx2 = Math.abs((centerW - this.x)) ** 2;
            this._radius2 = ((canvas.width) / 2) ** 2;
            this._dy = Math.sqrt(this._radius2 - this._dx2);
            this.y = getRandomArbitrary(centerH - this._dy, centerH + this._dy);

            // this.y = getRandomArbitrary(0, canvas.height);

            this._color = color;
            this.color = color;
            // this.r = dotSize;
            this.state = 'passive';
            this.d = 0;
            this.v = getRandomArbitrary(speed.down, speed.top);
            this.move = true;
            this.angle = getAngle(this.x, this.y, this._x, this._y);
        }

        checkPosition() {
            if (this.move) {
                let newX;
                let newY;
                const xIsOnPosition = Math.abs(this.x - this._x) < this.v + 1;
                const yIsOnPosition = Math.abs(this.y - this._y) < this.v + 1;

                if (xIsOnPosition && yIsOnPosition) {
                    newX = this._x;
                    newY = this._y;
                    this.move = false;
                    doneDots = doneDots + 1;

                    ctxStatic.fillStyle = this.color;
                    ctxStatic.fillRect(newX, newY, dotSize, dotSize);
                } else {
                    newX = this.x - (this.v * this.angle.sin);
                    newY = this.y - (this.v * this.angle.cos);
                }

                this.x = Math.fround(newX);
                this.y = Math.fround(newY);
            }
        }

        reDraw() {
            if (this.move) {
                ctx.fillStyle = this.color;
                // circle
                // ctx.beginPath();
                // ctx.arc(this.x - this.r, this.y - this.r, this.r, 0, 2 * Math.PI);
                // ctx.fill();
                // rect
                ctx.fillRect(this.x, this.y, dotSize, dotSize);
            }
        }
    };

    function getPixel(imagedata, x, y) {
        const position = (x + imagedata.width * y) * 4;
        const data = imagedata.data;
        return { r: data[position], g: data[position + 1], b: data[position + 2], a: data[position + 3] };
    };

    function createDataMash() {
        for (let y = 0, y2 = imagedata.height; y < y2; y += imgStep) {
            for (let x = 0, x2 = imagedata.width; x < x2; x += imgStep) {
                const pixelColor = getPixel(imagedata, x, y);
                const color = "rgb(" + pixelColor.r + ", " + pixelColor.g + ", " + pixelColor.b + ")";

                if (
                    pixelColor.r < blackBorder &&
                    pixelColor.g < blackBorder &&
                    pixelColor.b < blackBorder
                ) { } else {
                    mash.push(new Dot(x, y, color));
                }
            }
        }
        requestAnimationFrame(renderLoop);
    };

    function reDrawDots() {
        for (let i in mash) {
            mash[i].reDraw();
        }
    };

    function reCalculateDot(params) {
        for (let i in mash) {
            mash[i].checkPosition();
        }
    }

    function draw() {
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        reDrawDots();
    };

    const prerenderArr = [];
    let canPlay = false;

    function renderLoop() {
        stats.begin();

        // body
        // now = performance.now();
        // dt = dt + ((now - last) / 1000);

        //       
        // while (dt > STEP) {
        //     dt = dt - STEP;
        //     reCalculateDot();
        // }
        // last = now;

        //   
        // renderCharter(dt * FPS);

        reCalculateDot();
        draw();

        if (false) {
            let blob;
            canvasPrerender.toBlob((e) => {
                blob = e;

                const reader = new FileReader();
                reader.readAsDataURL(blob); //  Blob  base64   onload

                reader.onload = function () {
                    const image = document.createElement("img");
                    image.src = reader.result;
                    prerenderArr.push(image);
                };
            });
        }

        stats.end();
        if (doneDots !== mash.length) {
            if (canPlay) {
                requestAnimationFrame(renderLoop);
            }
        } else {
            console.log('finaly');
            console.log(prerenderArr[20].src);

            // requestAnimationFrame(drowPreImg);
        }
    };

    let i = 0;
    function drowPreImg() {
        stats.begin();
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        ctx.drawImage(prerenderArr[i], 0, 0);
        i = i + 1;

        if (i < prerenderArr.length) {
            stats.end();
            requestAnimationFrame(drowPreImg);
        }
    }

    let doestStarted = true;
    window.addEventListener('scroll', function (e) {
        lastKnownScrollPosition = window.scrollY;

        if (((h - window.scrollY) < 50) && doestStarted) {
            doestStarted = false;
            canPlay = true;
            requestAnimationFrame(renderLoop);
        }

    });

    createDataMash();
}, 100);
